text = ''
freq = 'ETAONRISHDLFCUMGPYWBVKXJQZ'
analasys = []
for a in freq:
    q = 0
    for w in text:
        if a == w:
            q = q + 1
    add = q,a
    analasys.append(add)
analasys.sort()
analasys.reverse()
order = ''
for r in analasys:
    order= order+r[1]
new = ''
for t in text:
    t = freq[order.index(t)]
    new = new + t
print(new)